import { View, Text, StyleSheet, TouchableOpacity } from 'react-native'
import React from 'react'
import { useNavigation } from '@react-navigation/native';
import Logoview from '../component/Logoview';

const Adminpanel = () => {
  const navigation = useNavigation();
  return (
    <View>
      <Logoview/>
    <View style={styles.buttonContainer}>
              
                <TouchableOpacity style={styles.button} onPress={() => navigation.navigate('Page1')}>
                    <Text style={styles.buttonText}>Add Sciencetific object</Text>
                </TouchableOpacity>
                <TouchableOpacity style={styles.button} onPress={() => navigation.navigate('Page2')}>
                    <Text style={styles.buttonText}>Add Geomatric Shape </Text>
                </TouchableOpacity>
                <TouchableOpacity style={styles.button} onPress={() => navigation.navigate('Page3')}>
                    <Text style={styles.buttonText}>Add Currencies</Text>
                </TouchableOpacity>
                <TouchableOpacity style={styles.button} onPress={() => navigation.navigate('Page3')}>
                    <Text style={styles.buttonText}>Insert Instructions </Text>
                </TouchableOpacity>
            </View>
            </View>
  )
}

export default Adminpanel;


const styles = StyleSheet.create({
  container: {
      flex: 1,
      backgroundColor: '#D6D6D6', 
      justifyContent: 'center',
      alignItems: 'center',
  },
  buttonContainer: {
      marginBottom: 50,
      width: '100%',
      justifyContent: 'space-around',
      alignItems: 'center',
      
  },
  button: {
      backgroundColor: '#0BCEF5',
      padding: 10,
      borderRadius: 5,
      marginBottom:10,
      padding:20,
      width:300
      
      
  },
  buttonText: {
      color: '#fff',
      fontSize: 16,
  },
});
